import React, { useEffect, useState } from "react";
import "./main.css";
import "./processing.css";
import { Link, useNavigate } from "react-router-dom";
function Processing() {
  const [keyword, setKeyword] = useState(""); // keyword saved from Keyword page
  const [progress, setProgress] = useState(25); // percent done (backend will later set this)
  const [status, setStatus] = useState({
    objectDetection: "completed",
    musicRecommendation: "processing",
    facialExpression: "pending",
    storyGeneration: "pending",
  });

  // Later this will call your backend API (e.g., /api/progress)
  // and update status + progress accordingly
  useEffect(() => {
     const storedKeyword = localStorage.getItem("selectedKeyword");
    if (storedKeyword) {
      setKeyword(storedKeyword);
    }
    // Example: simulate API polling
    const interval = setInterval(() => {
      // Here you’ll call your backend API to get updated progress
      // fetch("/api/status").then(res => res.json()).then(data => { setProgress(data.progress); setStatus(data.status); });
    }, 3000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div>
      <h1 className="top-heading">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/iconmusic.webp`}
          width="50"
          height="55"
          alt="MoodMelody Logo"
        />{" "}
        MoodMelody
      </h1>

      <p className="top-Description">AI Processing in Progress</p>

      <div className="uploads-flex">
        <img
          src={`${process.env.PUBLIC_URL}/fyp-images/vedio.jpg`}
          alt="Video"
          className="vedio-icon"
        />

        {/* ✅ Show keyword inside quotation marks */}
        <h3 className="keyword-heading">
          Keyword = “{keyword || "—"}”
        </h3>
      </div>

      {/* Progress bar (dynamic width) */}
      <div className="progress-bar">
        <div
          className="progress-fill"
          style={{ width: `${progress}%` }}
        ></div>
      </div>

      <div className="processing-content">
  <div className="processing-steps">
    {/* Steps on left */}
    <div className="step">
      <img src={`${process.env.PUBLIC_URL}/fyp-images/tick.png`} alt="Status" className="step-icon" />
      <p>Object Detection</p>
    </div>
    <div className="step">
      <img src={`${process.env.PUBLIC_URL}/fyp-images/loading.png`} alt="Status" className="step-icon" />
      <p>Music Recommendation</p>
    </div>
    <div className="step">
      <img src={`${process.env.PUBLIC_URL}/fyp-images/pending.png`} alt="Status" className="step-icon" />
      <p>Facial Expression Analysis</p>
    </div>
    <div className="step">
      <img src={`${process.env.PUBLIC_URL}/fyp-images/pending.png`} alt="Status" className="step-icon" />
      <p>Story Generation</p>
    </div>
  </div>

  {/* Status text right beside steps */}
  <div className="status-section">
    <p>Completed</p>
    <p>Processing...</p>
    <p>Pending</p>
    <p>Pending</p>
  </div>
</div>


      <button className="cancel-btn">Cancel Processing</button>
 <nav aria-label="Page navigation" className="page-nav">
        <ul className="pagination-nav">
          <li className="page-item">
            <Link to="/keyword" className="page-link">
              <img
                src={`${process.env.PUBLIC_URL}/fyp-images/previous.png`}
                width="40"
                height="45"
                alt="Previous"
                className="previous"
              />
            </Link>
          </li>
          <li className="page-item next-link">
            <Link to="/result" className="page-link">
              <img
                src={`${process.env.PUBLIC_URL}/fyp-images/next.png`}
                width="40"
                height="45"
                alt="Next"
                className="next"
              />
            </Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Processing;
